DISCENTES VETERANOS

DISCIPLINAS OFERTADAS PELOS CURSOS INTERDISCIPLINARES DE INGRESSO

1. Nas matrículas em disciplinas ofertadas pelos cursos interdisciplinares de ingresso, os(as) discentes serão alocados(as) nas vagas considerando os parâmetros ordenados como segue:

I - Curso interdisciplinar de ingresso para o qual a disciplina seja obrigatória;

II - Mesmo turno de matrícula do(a) discente e oferta da disciplina;

III - Coeficiente de Progressão, em ordem decrescente;

IV - Coeficiente de Aproveitamento, em ordem decrescente.

DISCIPLINAS OFERTADAS PELOS CURSOS DE FORMAÇÃO ESPECÍFICA

1. Nas matrículas em disciplinas ofertadas pelos cursos de formação específica, os (as) discentes serão alocados nas vagas considerando os seguintes parâmetros na ordem que segue:

I - Vínculo (matrícula ou reserva de vaga) com curso de formação específica para o qual a disciplina é obrigatória ou de opção limitada;

1

II - Mesmo turno de matrícula do(a) discente e oferta da disciplina;

III - Coeficiente de Progressão, em ordem decrescente;

IV - Coeficiente de Aproveitamento, em ordem decrescente.

2. Nas matrículas em disciplinas ofertadas pelos cursos de formação específica, serão reservadas 20% (vinte por cento) das vagas aos discentes que não possuam vínculo com o curso de formação específica que tenha a disciplina como obrigatória ou de opção limitada em seu PPC, considerando a preferência, nesta ordem:

I - Turno de matrícula do curso de ingresso com o qual o(a) discente tem vínculo ou que colou grau;

II - Coeficiente de Progressão do curso de ingresso com o qual o(a) discente tem vínculo ou que colou grau, em ordem decrescente;

III - Coeficiente de Aproveitamento do curso de ingresso com o qual o(a) discente tem vínculo ou que colou grau, em ordem decrescente.

5. Quais os critérios para alocação de vaga nas disciplinas durante a primeira fase da matrícula?

(Artigos 9º e 12 da Resolução ConsEPE nº 260)

Para todas as disciplinas dos ofertadas pelo cursos interdisciplinares de ingresso (BC&T, BC&H, LCH e LCNE) os critérios são, em ordem decrescente:

I - Curso interdisciplinar de ingresso para o qual a disciplina seja obrigatória;

II - Mesmo turno de matrícula do(a) discente e oferta da disciplina;

III - Coeficiente de Progressão (CP), em ordem decrescente;

IV - Coeficiente de Aproveitamento (CA), em ordem decrescente.

Para as disciplinas ofertadas pelos cursos de formação específica, os critérios são, em ordem decrescente:

I - Vínculo (matrícula ou reserva de vaga) com curso de formação específica para o qual a disciplina é obrigatória ou de opção limitada;

II - Mesmo turno de matrícula do(a) discente e oferta da disciplina;

III - Coeficiente de Progressão (CP), em ordem decrescente;

IV - Coeficiente de Aproveitamento (CA), em ordem decrescente.

Em todas as turmas ofertadas pelos cursos de formação específica haverá 20% das vagas reservadas para discentes que não têm vínculo com o curso.

Observações:

Os horários indicados para a partida dos ônibus são estimados, sujeitos à variação em decorrência do trânsito, imprevistos e mudanças climáticas. Recomenda-se chegar ao local de embarque com antecedência. Além dos pontos acima mencionados, o transporte intercampi possui permissão de parada para operações de DESEMBARQUE no seguinte local: Avenida Senador Vergueiro - altura do número 2685 (em ambos os sentidos do trajeto mediante prévia solicitação ao condutor);

As operações de DESEMBARQUE citadas anteriormente ocorrerão nos seguintes intervalos de horário:

Entre às 13h50 e às 17h20 (viagens 29 a 39 - sentido SBC e viagens 28 a 37 - sentido S.A);

A partir das 19h50 (viagem 50 - sentido SBC e viagem 47 - sentido S.A).

Para a utilização dos serviços de transporte interunidades da UFABC é OBRIGATÓRIO apresentar um comprovante de vínculo com a UFABC ao condutor do veículo. Verifique as possibilidades de Comprovantes de vínculo (https://pu.ufabc.edu.br/images/Fretado- Tabelas/Comprovantes de Vnculo UFABC.pdf).
